&\Rightarrow\qquad 2\left(\frac{\cos x + \cos y + \cos z}{3}\right) = -1 \\
&\Rightarrow\qquad \boxed{\cos x + \cos y + \cos z = -1} \tag*{(1)}
\end{align*}

Now we will solve for $\sin x$, $\sin y$, and $\sin z$:
\begin{align*}
&\sin x + \sin y + \sin z = 0 \\
&\Rightarrow\qquad 2\left(\frac{\sin x + \sin y + \sin z}{3}\right) = -1 \\
&\Rightarrow\qquad \boxed{\sin x + \sin y + \sin z = -1} \tag*{(2)}
\end{align*}

Now, we have the following:
\begin{align*}
(\cos^2x+\sin^2x)+(\cos^2y+\sin^2y)+(\cos^2z+\sin^2z) &= 1 + 1 + 1 \\
&= \boxed{3} \tag*{(3)}
\end{align*}

Now we will solve for $\cos (2x - y - z)$:
$$
\begin{aligned}
&\cos(2x-y-z)\\
&=\cos(x+y+z-2x)\\
&=\cos(x+y+z)\cos(-2x)+\sin(x+y+z)\sin(-2x)\\
&=(\cos x+\cos y + \cos z)(\cos 2x)-(\sin x+\sin y + \sin z)\sin 2x \\
&= (-1)(\cos 2x)-(-1)(\sin 2x) & \text{(Using equations (1) and (2))} \\
&= -1
\end{aligned}
$$

