Let $p(x) = x^3+2x^2+5x+7$. The sum of the roots of a polynomial is equal to the negation of its coefficient of the second-highest degree term, which is $\frac{-2}{1}=-2.$ So, we have $$a+b+c=-2.$$Since $p(x) = (x-a)(x-b)(x-c)$, we can expand this expression and get \begin{align*}
x^3+2x^2+5x+7 &= x^3-(a+b+c)x^2+(ab+ac+bc)x-abc\\
&=x^3 -(-2)x^2+(ab+ac+bc)x-abc.
\end{align*}Comparing the coefficients of $x$, we obtain $(ab+ac+bc)=5$. Also, notice that \begin{align*}
\frac{1}{a}+\frac{1}{b}+\frac{1}{c}&=\frac{abc}{abc}+\frac{abc}{abc}+\frac{abc}{abc}\\
&=\frac{3(abc)}{abc}\\
&=3.
\end{align*}
Therefore, the answer is \boxed{3}.
