\end{align*}
2. Make a row for the divisor, $p(y) = 3y - 2$. We'll fill in the values as we go along.

\begin{align*}
&3, &-4,&5,&-13,&+4\\
\cline{2-6}
&3,&-6,&9,&-18,&+0\\
\hline
\end{align*} The zeros fill in the top row of the synthetic division.

3. Multiply the last entry from the previous row ($-18$) by the divisor's coefficient ($3$) and subtract it from the next value to be filled in. Fill in the result:

\begin{align*}
&3, &-4,&5,&-13,&+4\\
\cline{2-6}
&3,&-6,&9,&-18,&+0\\
\hline
&0,&0,&0,&54,&0\\
\end{align*}

4. Add the new row to the previous rows:

\begin{align*}
&3, &-4,&5,&-13,&+4\\
\cline{2-6}
&3,&-6,&9,&-18,&+0\\
\hline
&3,&-2,&-1,&54,&4\\
\end{align*}

The remainder is the value in the bottom row, which is $\boxed{4}$.

