Let's solve this problem step by step.

First, we need to find the length of vectors $AB$ and $AC$. We can do this using the formula:

$$\left|\vec{v}\right|=\sqrt{\sum_{i=1}^{n}(x_i-y_i)^2}$$

where $\vec{v}$ is a vector with components $(x_1,\ldots,x_n)$ and $(y_1,\ldots,y_n)$, and $n$ is the number of dimensions.

For $AB$, we have:

\begin{align*}
|AB|&=\sqrt{(3-1)^2+(-4+11)^2+(1-2)^2}\\
&=\sqrt{2^2+7^2+1^2} = \sqrt{50}
\end{align*}

For $AC$, we have:

\begin{align*}
|AC|&=\sqrt{((3)+(-2))^2+((-4)+1)^2+(1+1)^2}\\
&=\sqrt{(1)^2+5^2+2^2} = \sqrt{50}
\end{align*}

Now that we have the lengths of $AB$ and $AC$, we can use the law of cosines to find the cosine of $\angle ABC$:

$$\cos(\angle ABC)=\frac{|AB|^2+|AC|^2-|BC|^2}{2|AB||AC|}$$

where $BC$ is a vector from $C$ to $B$. We don't need to find the length of $BC$, though, because it's not necessary for this problem.

Now we can use the formula above to find $\cos(\angle ABC)$:

\begin{align*}
\cos(\angle ABC)&=\frac{(50)^2+(50)^2-(1-3)^2+(-4-1)^2+(1-1)^2}{2(50)(50)}\\
&=0.8
\end{align*}

Finally, we can use a calculator to find the angle:

$$\angle ABC = \arccos(0.8) = \boxed{36.87^\circ}$$

